import React from 'react';

class Main extends React.Component{
    render(){
        return(
            <div className="App">
                <div className="App-header">
                    <div className="container">
                        <div className="row">
                            <div className="col-lg-12 offset-lg-0 my-5">
                                <h1 classname="header-main-page">Maqure Team!!</h1>
                                <h2>
                                    <b>Solution to your end to end Material procurement & Financing, powered by Blockchain
                                    through Maqure, Save Time & Money, by procuring raw material from any among many of suppliers at a guaranteed lowest price in the market. Maqure is here to serve you!
                
                                    </b>
                                </h2>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
            
        )
    }
}
export default Main;
